let t = db.refresh_tokens.aggregate([
  { $match: { client_id: "barra-qa@apps.globoid" } },
  { $sort: { requested_at: -1 } },
  { $group: {
      _id: "$request_id",
      ids: { $push: "$_id" }
    }
  },
  { $project: {
      _id: 0,
      request_id: "$_id",
      tokens_to_delete: { $slice: ["$ids", 1, { $size: "$ids" }] }
    }
  }
])

